    public static Iterable<City> findAll(IgniteCache<Long, City> cache) {
        final Iterator<Cache.Entry<Long, City>> iter = cache.iterator();
        return new Iterable<City>() {
            @Override public Iterator<City> iterator() {
                return new Iterator<City>() {
                    @Override public boolean hasNext() {
                        return iter.hasNext();
                    }
                    @Override public City next() {
                        return iter.next().getValue();
                    }
                    @Override public void remove() {
                        iter.remove();
                    }
                };
            }
        };
    }

